import React, { useState } from 'react';
import axios from 'axios';
import Header from '../components/header'; 
import Footer from '../components/footer';

const NewOrderForm = () => {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    type: 'regular load',
    kilo: '',
    service: 'Washing',
    description: ''
  });

  const handleInputChange = e => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async e => {
    e.preventDefault();
    try {
      const orderData = {
        firstName: formData.firstName,
        lastName: formData.lastName,
        type: formData.type,
        kilo: formData.kilo,
        service: formData.service,
        description: formData.description
      };

      // You need to replace the URL with the actual endpoint for posting orders
      await axios.post('http://localhost:3000/order/postorder', orderData);
      alert('Order submitted successfully');
    } catch (error) {
      console.error('Error submitting order:', error);
      alert('Error submitting order');
    }
  };

  return (
    <div>
      <Header />
      <div className="container">
        <br />
        <h1 className="mb-4">New Order Form</h1>
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="firstName">First Name:</label>
            <input type="text" className="form-control" id="firstName" name="firstName" value={formData.firstName} onChange={handleInputChange} />
          </div>

          <div className="form-group">
            <label htmlFor="lastName">Last Name:</label>
            <input type="text" className="form-control" id="lastName" name="lastName" value={formData.lastName} onChange={handleInputChange} />
          </div>

          <div className="form-group">
            <label htmlFor="type">Item Type:</label>
            <select className="form-control" id="type" name="type" value={formData.type} onChange={handleInputChange}>
              <option value="regular load">Regular Load</option>
              <option value="heavy load">Heavy Load</option>
            </select>
          </div>

          <div className="form-group">
            <label htmlFor="kilo">Kilos:</label>
            <input type="number" className="form-control" id="kilo" name="kilo" value={formData.kilo} onChange={handleInputChange} />
          </div>

          <div className="form-group">
            <label htmlFor="service">Service:</label>
            <select className="form-control" id="service" name="service" value={formData.service} onChange={handleInputChange}>
              <option value="Washing">Washing</option>
              <option value="Drying">Drying</option>
            </select>
          </div>

          <div className="form-group">
            <label htmlFor="description">Description:</label>
            <textarea className="form-control" id="description" name="description" value={formData.description} onChange={handleInputChange}></textarea>
          </div>

          <button type="submit" className="btn btn-primary">Submit</button>
        </form>
      </div>
      <Footer />
    </div>
  );
};

export default NewOrderForm;
